import Link from "next/link";

const linkStyle = {
  textDecoration: "none",
  color: "#9b59b6",
};
function Header() {
  return (
    <ul>
      <li>
        <Link href="/" style={linkStyle}>
          Home
        </Link>
      </li>
      <li>
        <Link href="/about" style={linkStyle}>
          About
        </Link>
      </li>
      <style jsx>{`
        ul {
          padding-left: 0;
          width: 20%;
          display: flex;
          list-style-type: none;
        }
        ul li {
          margin-right: 20px;
        }
      `}</style>
    </ul>
  );
}
export default Header;
